import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

let posts = [
  {id: 1, post:'I love you', likeCount: 15}, 
  {id: 2, post:'Follow me', likeCount: 11}
]

let dialogs = [ 
  {id: 1, name:'Viktor'}, 
  {id: 2, name:'July'}, 
  {id: 3, name:'Kate'}, 
  {id: 4, name:'Nasty'}, 
  {id: 5, name:'Irina'} 
]

let massages = [ 
  {id: 1, massage:"Hi! What's up?"}, 
  {id: 2, massage:"Great"}, 
  {id: 3, massage:"Yo"}, 
  {id: 4, massage:"Yo"}
]

ReactDOM.render(
  <React.StrictMode>
    <App posts = {posts} dialogs = {dialogs} massages = {massages}/>
  </React.StrictMode>,
  document.getElementById('root')
);

// dialogs = {dialogs} massages = {massages}

